import React, { useEffect, useState } from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

import Interface from "./routes/InterfaceTact"
import Login from "./routes/Login"
import PrivateRoute from "./routes/PrivateRoute";
import {CookiesProvider}  from 'react-cookies';

export default function App() {

    const [userConnected,setUserConnected]=useState(null)

    const handleLogin=(value)=>{
        console.log(value)
        setUserConnected(value)
    }

    // useEffect(()=>{
    //     console.log(userConnected)
    // },[userConnected])



    


  return (
    // <CookiesProvider>
    <Router>
      <div style={{
          position:"absolute",
          top:250,
          zIndex:50
          }}>
        <nav>
          <ul>
            <li>
              <Link to="/tact">Interface1</Link>
            </li>
            <li>
              <Link to="/inter">Interface2</Link>
            </li>
            <li>
              <Link to="/login">Login</Link>
            </li>
          </ul>
        </nav>
        </div>
        <Switch>
          <PrivateRoute 
            userConnected={userConnected}
            path="/tact"
            component={Interface }
          />
            <PrivateRoute 
            userConnected={userConnected}
            path="/inter"
            component={Interface }
          />
          <Route path="/login">
            <Login 
                userConnected={userConnected}
                handleLogin={handleLogin}
            />
          </Route>
          
        </Switch>
      
    </Router>
    // </CookiesProvider>
  );
}
